import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';
//HomePage Sign
import Welcoming from './components/welcoming/welcomingHomePage';
//Trainee
import TraineeHome from './components/trainee/traineeHomePage';
import TraineeProfile from './components/trainee/editProfile';
import AppliedOpportunities from './components/trainee/appliedOpportunity';
//Company
import CompanyHome from './components/company/appliedTrainee';
import CompanyProfile from './components/company/companyProfile';
import addOpportunity from './components/company/addOpportunity';
//Sign
import SignIn from'./components/signIn-signUp/signIn';
import forgottenPassword from './components/signIn-signUp/forgottenPassword';
import SignUp from'./components/signIn-signUp/routeSignUp';
import Student from './components/signIn-signUp/signUpTrainee';
import Trainer from'./components/signIn-signUp/signUpCompany';
//Company
const App = () => {
  return (
   <Router>
   <div>
    <Switch>
    <Route path='/' exact component={Home} />
    <Route path='/SignIn' component={SignIn} />
    <Route path='/SignUp' component={SignUp} />
    <Route path='/StudentSignUp' component={Student} />
    <Route path='/TrainerSignUp' component={Trainer} />
    <Route path='/forgottenPassword' component={forgottenPassword} />

    <Route path='/TraineeHome' component={TraineeHome} />
    <Route path='/TraineeProfile' component={TraineeProfile} />    
    <Route path='/AppliedOpportunities' component={AppliedOpportunities} />

    <Route path='/CompanyHome' component={CompanyHome} />
    <Route path='/CompanyProfile' component={CompanyProfile} />    
    <Route path='/addOpportunity' component={addOpportunity} />
    </Switch>
    </div>
   </Router>
  );
}

const Home =() =>(
  <div>
    <Welcoming />
  </div>
);
export default App;
